import '../css/Classroom.css'

function MyclassroomItem() {
    return (
        <div className='myClassroomItem'>
            <div></div>
            <div className='myClassroomAvatar'>
                <img src="/assets/images/penguine.jpeg" alt="Avatar" class="avatar"/>
            </div>
        </div>
    )
}

export default MyclassroomItem
